import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper.min.css';

import 'swiper/swiper-bundle.min.css';

const CategoryButtons = () => {
  return (
    <Swiper
      spaceBetween={50}
      slidesPerView={5}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
    >
      <SwiperSlide><div><h3>Slide 1</h3></div></SwiperSlide>
      <SwiperSlide><div><h3>Slide 2</h3></div></SwiperSlide>
      <SwiperSlide><div><h3>Slide 3</h3></div></SwiperSlide>
      <SwiperSlide><div><h3>Slide 4</h3></div></SwiperSlide>
      <SwiperSlide><div><h3>Slide 5</h3></div></SwiperSlide>
      {/* ... more slides */}
    </Swiper>
  );
};

export default CategoryButtons;
